class App extends Component{
  render () {  
    return (
      <BrowserRouter>
        <div className="App">
          <Navbar />
            <Route exact path='/' component={Home} />
            <Route path='/cases' component={Cases} />
            <Route path='/info' component={Info} />
            <Route path='/report' component={Report} />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
